import React, { Component } from 'react'

class Form extends Component {
    constructor(props) {
        super(props)

        this.state = {
             username:" ",
             email:" "
        }
    }

    changeHandlerUser=(event)=>{
        this.setState({
            username:event.target.value

        })
    }

    changeHandlerEmail=(event)=>{
        this.setState({
            email:event.target.value

        })
    }




    render() {
        return (
           <form>
               <div>
                <label>Username</label><br>
                <input type='text'value={this.state.username} onChange={this.changeHandlerUser}></input></br>


                <input type='text'value={this.state.username} onChange={this.changeHandlerEmail}></input>

               </div>

           </form>
        )
    }
}

export default Form
